The art of multi-tasking…with a llama and a donkey during a live shot… Notice the backhand feeding. 🦙

@worldvisionusa was on our show Monday. The producers asked if I was cool getting in the pen with animals.. That’s a hard YES… This Southern girl loves herself some farm animals. 

There was a llama, baby llama, donkey, chicken, 2 ducks, a goat (who I think had a crush on me), and a miniature cow.

@worldvisionusa empowers people out of poverty. Check out their site on how they have been changing lives for many decades. It’s a great gift for the holidays. 

